                            <section id="education-framework-Ww" class="education-framework-Ww">
                              <div class="container">
                                          <div class="holder">
                                            <h2>
                                                        Cómo funcionará nuestra plataforma educativa
                                            </h2>
                                            <p>
                                                        Sumérgete en cursos en línea que ofrecen una experiencia de aprendizaje rica y atractiva. Los participantes navegan a través de módulos a su propio ritmo, accediendo a recursos
